script: |
  super -f text -I q12753.spq | sort > q12753.out

inputs:
  - name: q12753.spq
    data: |
      SELECT ALL col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col2 * + 46 NOT BETWEEN NULL AND col2 * - col0 * + 5 + 67 / - + col2 + - col0 - CAST ( col1 AS INTEGER );
  - name: tab1

outputs:
  - name: q12753.out
    data: |
